import React from "react";
import Cookies from 'js-cookie'
const homePage = () => {
    const token = Cookies.get('token')
    if (token) {
        console.log("log in");
    }
    else {
        console.log("not log in");
    }
    return (
        <div>
            Homepage
        </div>
    );
}


export default homePage;
